import React from 'react';

function SearchItems(props) {
  const { input1, setInput1, input2, setInput2, handleSubmit } = props;

  return (
    <form onSubmit={handleSubmit}>
      <div style={{ display: "flex" }}>
        <label className="input-label">
          <input type="text" placeholder="Enter college name" value={input1} onChange={(e) => setInput1(e.target.value)} />
        </label>
        <label className="input-label">
          <input type="text" placeholder="Enter major name" value={input2} onChange={(e) => setInput2(e.target.value)} />
        </label>

        <button type="submit">+</button>
      </div>
    </form>
  );
}

export default SearchItems;
